import React from 'react';

const SuperViewFrom = React.memo(function ({columns, item}) {
    function addressConcatenation(item){
        let tempAddress = '';
        if(item !== undefined && item['address'] !== undefined){
            tempAddress = item['address']['streetAddress'] + ' ' + item['address']['city'] + ' '
                + item['address']['state']+ ' ' + item['address']['zip'];
        }
        return tempAddress;
    }

    let counter = 0;

    return <tbody>
        {columns.map((col)=><tr key={counter++}>
            <td>{col}</td>
            <td>{col === 'address' ? addressConcatenation(item) : item[col]}</td>
        </tr>)}
    </tbody>
});

export default SuperViewFrom;
